package main

import "fmt"

func main() {
	fmt.Println(removeDuplicates(""))
}
func removeDuplicates(s string) string {
	removed := false
	val := []rune(s)
	for i := 0; i < len(val)-1; i++ {
		if val[i] == val[i+1] {
			val = append(val[0:i], val[i+2:]...)
			removed = true
		}
	}
	if removed {
		return removeDuplicates(string(val))
	}
	return string(val)
}
